/// cities : [{"id":"123","name":" Allahabad","image":"","description":"u.p.","country_id":"3","state_id":"4","created_at":"2022-12-19 17:49:26","updated_at":"2022-12-19 17:49:26"},{"id":"121","name":" Dhanbad","image":"","description":"u.p.","country_id":"3","state_id":"4","created_at":"2022-12-19 17:47:54","updated_at":"2022-12-19 17:47:54"},{"id":"108","name":" Indore","image":"","description":"Madhya Pradesh","country_id":"3","state_id":"115","created_at":"2022-12-19 17:32:26","updated_at":"2022-12-19 17:32:26"},{"id":"14","name":"Agra","image":"636903315bc7e.jpg","description":"A peek into the great Mughal heritage of India can be witnessed and explored in the present-day city of Agra. Housing one of the Seven Wonders of the World, the Taj Mahal is undoubtedly one of the greatest symbols of love and India's pride. Banking along the Yamuna River is the city’s rich history and architecture, Agra offers an experience of not only Mughal heritage but also Roman catholic culture too which lures the tourists to dive deeper into the history of the city.","country_id":"3","state_id":"4","created_at":"2022-11-07 18:38:01","updated_at":"2022-12-09 18:19:28"},{"id":"101","name":"Ahmedabad","image":"","description":"Gujarat","country_id":"3","state_id":"108","created_at":"2022-12-19 17:21:41","updated_at":"2022-12-19 17:21:41"},{"id":"12","name":"Amritsar","image":"636902e068706.jpg","description":"The rich Sikh culture’s land is a major tourist spot for Amritsar’s Golden Temple. It's a lifetime of experience to seek blessings from the golden temple and share a meal of langar with dozens of other devotees gathered around the enormous, volunteer-run kitchen. Amritsar is a place for all the Punjabi foodies to add to their “Must Try” list. Feel patriotism in its true sense during the Wagah Border Ceremony, and wander around the city during your expedition to the Pakistani border.","country_id":"3","state_id":"5","created_at":"2022-11-07 18:36:40","updated_at":"2022-12-09 18:19:25"},{"id":"120","name":"Aurangabad","image":"","description":"Maharashtra ","country_id":"3","state_id":"1","created_at":"2022-12-19 17:46:59","updated_at":"2022-12-19 17:46:59"},{"id":"4","name":"Bangalore","image":"6369067c1fddf.jpg","description":"The city of techies is a place for all the people on the map. Bangalore is popular for its technology industry and welcoming nature for newcomers. This is a mini continent blessed with all the flavours from weather to lands where you can find diverse landscapes and varying temperatures. A unique blend of British style and modern style is one of the main attractions for anyone who visits Bangalore.","country_id":"3","state_id":"9","created_at":"2022-11-07 18:25:55","updated_at":"2022-12-09 18:19:16"},{"id":"110","name":"Bhopal","image":"","description":"madhya pradhesh","country_id":"3","state_id":"115","created_at":"2022-12-19 17:33:45","updated_at":"2022-12-19 17:34:48"},{"id":"197","name":"Bhopal ","image":"","description":"Bhopal is a city in the central Indian state of Madhya Pradesh. It's one of India’s greenest cities. There are two main lakes, the Upper Lake and the Lower Lake. On the banks of the Upper Lake is Van Vihar National Park, home to tigers, lions and leopards. The State Museum has fossils, paintings and rare Jain sculptures. Taj-ul-Masjid is one of Asia’s largest mosques, with white domes, minarets and a huge courtyard","country_id":"3","state_id":"115","created_at":"2023-10-20 19:35:12","updated_at":"2023-10-20 19:37:27"},{"id":"194","name":"Bilaspur (CG)","image":"","description":"Another indian city in Southeast","country_id":"3","state_id":"106","created_at":"2023-06-19 15:14:43","updated_at":"2023-08-24 13:39:40"},{"id":"193","name":"Bilaspur (HP)","image":"","description":"Another city name in India","country_id":"3","state_id":"6","created_at":"2023-06-19 15:09:13","updated_at":"2023-08-22 13:06:59"},{"id":"11","name":"Chandigarh","image":"636902b83aa81.jpg","description":"The idea of serenity and a city are opposite concepts. Chandigarh, however, is a rare example of modernity co-existing with nature's preservation. It's known for its tidiness and beauty of maintenance. This city has one of the best architecture. Punjabi mirth is sometimes rivalled by their girth, and the foodies here often stay up late eating.","country_id":"3","state_id":"5","created_at":"2022-11-07 18:36:00","updated_at":"2022-12-09 18:19:24"},{"id":"99","name":"Chennai","image":"","description":"Chennai","country_id":"3","state_id":"125","created_at":"2022-12-19 17:18:48","updated_at":"2022-12-19 17:18:48"},{"id":"6","name":"Cochin","image":"636900d9a63d4.jpg","description":"The city with a history of Arab, Chinese and European merchants yet with its glory towards the culture of India, it’s the city of Cochin for you! Its colonial bungalows and the diverse houses of worship is something that can be a “wow” moment for anyone. The biennale festival which is an attraction to see its main authentic dance form Kathakali is the highlight of this beautiful city.","country_id":"3","state_id":"8","created_at":"2022-11-07 18:28:01","updated_at":"2022-12-09 18:19:18"},{"id":"8","name":"Coorg","image":"636901a6e1223.jpg","description":"Popular as the Scotland of India, Coorg is home to major tea and coffee companies across the country. It's a perfect tourist spot for anyone who loves the green lush and the white mist. The scenic beauty of clouds touching the hills can make you feel sublime and fall in love with the weather. The surroundings of Western Ghats and thick dense forests make this place a major tourist attraction.","country_id":"3","state_id":"9","created_at":"2022-11-07 18:31:26","updated_at":"2022-12-09 18:19:20"},{"id":"3","name":"Delhi","image":"","description":"The capital of India, famous for its heritage, culture, people and food, never fails to make a special place in its visitor's hearts. The red contemporary buildings etch into a traveller's mind depicting historic grandeur. From busy flea markets to high-end luxury shopping malls, Delhi has a way to every traveller's heart through shopping and food. From purani dilli ki chaat to the lip-smacking paranthas of paranthe wali gali, your taste buds will refuse to forget the taste of Delhi's delicacies.","country_id":"3","state_id":"11","created_at":"2022-11-07 18:25:11","updated_at":"2023-08-01 16:06:08"},{"id":"116","name":"Faridabad","image":"","description":"haryana","country_id":"3","state_id":"109","created_at":"2022-12-19 17:39:03","updated_at":"2022-12-19 17:39:03"},{"id":"113","name":"Ghaziabad","image":"","description":"u.p.","country_id":"3","state_id":"4","created_at":"2022-12-19 17:36:02","updated_at":"2022-12-19 17:36:02"},{"id":"5","name":"Goa","image":"63690092d6a16.jpg","description":"The mini Hawaii of India is the go-to destination for any friends’ trip or a wedding or a family vacation for the party-holics in town. Goa is a colourful town with shacks all around amongst the waves and humidity making it a perfect spot for tourists. Its impressive coastline has several beaches with a serene view and offers a beautiful memory to blend in the heart and lens forever.","country_id":"3","state_id":"10","created_at":"2022-11-07 18:26:50","updated_at":"2022-12-09 18:19:17"},{"id":"100","name":"Hyderabad","image":"","description":"Hyderabad","country_id":"3","state_id":"126","created_at":"2022-12-19 17:20:50","updated_at":"2022-12-19 17:20:50"},{"id":"1","name":"Jaipur","image":"6368ffdd58b9c.jpg","description":"Jaipur, the pink city, is a place that will continue to live in your dreams for long with its memorable blend of heritage and culture. Its rich heritage will stay as fond memories in your lens forever through which you can relive the charm of the city and cherish the authenticity of Rajasthan over and over. Also called 'the Paris of India', Jaipur won't fail to mesmerise you with its architectural brilliance and royal magnificence.","country_id":"3","state_id":"12","created_at":"2022-11-07 18:23:49","updated_at":"2022-12-09 18:19:13"},{"id":"105","name":"Kanpur","image":"","description":"uttar pradesh","country_id":"3","state_id":"4","created_at":"2022-12-19 17:26:26","updated_at":"2022-12-19 17:26:26"},{"id":"104","name":"Lucknow","image":"","description":"Uttar pradesh","country_id":"3","state_id":"4","created_at":"2022-12-19 17:25:34","updated_at":"2022-12-19 17:25:34"},{"id":"114","name":"Ludhiana","image":"","description":"punjab","country_id":"3","state_id":"5","created_at":"2022-12-19 17:36:29","updated_at":"2022-12-19 17:36:29"},{"id":"9","name":"Manali","image":"636901f4542d3.jpg","description":"To the backpackers, Manali is the perfect trip spot that you can explore with friends and family. The white stretches of mountains with abundant snow are one of its major attractions. This is the go-to place for all adventure freaks who love to try something new. In the winter, temperatures in Manali drop to minus degrees leaving you freezing. The place is one of the coldest in India with three hills adjacent to each other, each with a village and an old shrine.","country_id":"3","state_id":"6","created_at":"2022-11-07 18:32:44","updated_at":"2022-12-09 18:19:22"},{"id":"2","name":"Mumbai","image":"6369000c4cd6f.jpg","description":"If there's one city which is active all the day round, it's the city of dreams “Bombay”. It's always on the rails with diverse people chasing so many dreams and aiming to become zero to hero! This modern city with old world charm is known to fulfil the dreams of people around the country. The Maharashtrian cuisine, from street-side vada pavs and pani puris to the magnificent Taj, the city has to offer everyone a share of its delicacies and success.","country_id":"3","state_id":"1","created_at":"2022-11-07 18:24:36","updated_at":"2022-12-09 18:19:14"},{"id":"106","name":"Nagpur","image":"","description":"maharastra","country_id":"3","state_id":"1","created_at":"2022-12-19 17:28:48","updated_at":"2022-12-19 17:28:48"},{"id":"13","name":"Nainital","image":"636903026f97f.jpg","description":"Nainital is a Himalayan resort town in Uttarakhand, India. It radiated around the very famous lake Naini, from which the state derives its name. Nainital is home to a variety of aquatic animals, including crocodiles. The serene lands with white flares of hills are scenic for the camera and a treat to the eyes. A ride on colourful boats in Nainital's lake is an unforgettable experience.","country_id":"3","state_id":"3","created_at":"2022-11-07 18:37:14","updated_at":"2022-12-09 18:19:27"},{"id":"115","name":"Nashik","image":"","description":"maharastra","country_id":"3","state_id":"1","created_at":"2022-12-19 17:37:29","updated_at":"2022-12-19 17:37:29"},{"id":"122","name":"Navi Mumbai","image":"","description":"maharastra","country_id":"3","state_id":"1","created_at":"2022-12-19 17:48:53","updated_at":"2022-12-19 17:48:53"},{"id":"111","name":"Patna","image":"","description":"bihar","country_id":"3","state_id":"105","created_at":"2022-12-19 17:34:23","updated_at":"2022-12-19 17:34:23"},{"id":"102","name":"Pune","image":"","description":"Maharastra","country_id":"3","state_id":"1","created_at":"2022-12-19 17:23:19","updated_at":"2022-12-19 17:23:19"},{"id":"117","name":"Rajkot","image":"","description":"gujarat","country_id":"3","state_id":"108","created_at":"2022-12-19 17:39:42","updated_at":"2022-12-19 17:39:42"},{"id":"124","name":"Ranchi","image":"","description":"jharkhand","country_id":"3","state_id":"112","created_at":"2022-12-19 17:50:03","updated_at":"2022-12-19 17:50:03"},{"id":"195","name":"Sagar","image":"64c8df32177c0.jpg","description":"This is description .","country_id":"3","state_id":"115","created_at":"2023-08-01 16:02:18","updated_at":"2023-08-01 16:02:18"},{"id":"10","name":"Shimla","image":"63690265da89a.jpg","description":"Shimla greets you with its majestic snow-clad mountains, lush greenery and beautiful lakes. It holds the magic in the air which makes you drop your jaw. This is the perfect place for a vacation with family, friends or someone special. The place is pretty well known for its Victorian architecture and scenic beauty. Shimla offers the perfect view of snow and mountain ranges ranging into your camera through your eyes.","country_id":"3","state_id":"6","created_at":"2022-11-07 18:34:37","updated_at":"2022-12-09 18:19:23"},{"id":"119","name":"Srinagar","image":"","description":"j&k","country_id":"3","state_id":"111","created_at":"2022-12-19 17:42:25","updated_at":"2022-12-19 17:42:25"},{"id":"103","name":"Surat","image":"","description":"Gujarat","country_id":"3","state_id":"108","created_at":"2022-12-19 17:24:23","updated_at":"2022-12-19 17:24:23"},{"id":"109","name":"Thane","image":"","description":"maharastra","country_id":"3","state_id":"1","created_at":"2022-12-19 17:33:02","updated_at":"2022-12-19 17:33:02"},{"id":"191","name":"ujjain","image":"","description":"hiojio","country_id":"3","state_id":"115","created_at":"2023-06-12 13:57:47","updated_at":"2023-06-12 13:57:47"},{"id":"112","name":"Vadodara","image":"","description":"gujarat","country_id":"3","state_id":"108","created_at":"2022-12-19 17:35:34","updated_at":"2022-12-19 17:35:34"},{"id":"118","name":"Varanasi","image":"","description":"uttar pradesh","country_id":"3","state_id":"4","created_at":"2022-12-19 17:40:45","updated_at":"2022-12-19 17:40:45"},{"id":"107","name":"Visakhapatnam","image":"","description":"Andhra Pradesh","country_id":"3","state_id":"13","created_at":"2022-12-19 17:31:32","updated_at":"2022-12-19 17:31:32"}]

